import React from 'react';
import './App.css';

import Header from './components/Header';
import About from './components/About';
import Work from './components/Work';
import Footer from './components/Footer';
//import Contact from './components/Contact';

function App() {
  return (
    <div className="App">
      <Header />
      <About />
      <Work />
      <Footer />
    </div>
  );
}

export default App;
